const API_URL = 'http://www.omdbapi.com?apikey=46cefbd4';

function App() {
  return (
      <Routes>
        <Route index element={<MainPage />} />
        <Route exact path='/mainPage' element = {<MainPage />} />
        <Route path='/moviePage' element ={<MainPage />}> 
          <Route exact path=':imdbID' element = {<MoviePage />}/>
        </Route>
      </Routes> 


  );
}

export default App;
